Rear Admiral ({{lang|it|L'ammiraglio di divisione}}) '''Roberto Camerini''' (born 23 July 1955, [[Sliema]])<ref name="NavyBio">{{Cite web |url=http://www.marina.difesa.it/conosciamoci/organizzazione/comandienti/dipartimentali/mdpt_spezia/Pagine/cinc.aspx |title=Comandante in Capo}}</ref> is an Italian Navy officer, currently serving as Commander Maritime Command North.
He joined the Navy in 1974 and attended the Naval Academy before joining the submarine branch. He commanded the submarine [[USS Harder (SS-568)|Romeo Romei]] from 1985 to 1986 and [[Sauro-class submarine|Giuliano Prini]] from 1984-1990 as well as the 2nd Submarine Group.
From 2013 to 2015 he served as Commander Maritime Command Sicily before being appointed Commander Maritime Command North ({{lang|it|Comandante del Comando Marittimo Nord}}) in February 2015.<ref name="Citadella">{{cite web |url=http://www.cittadellaspezia.com/La-Spezia/Attualita/Marina-militare-arriva-l-ammiraglio-174456.aspx |title=Marina militare, arriva l'ammiraglio Camerini al posto di Toscano |date=20 January 2015}}</ref>
